import React from "react";
import Logo from "./images/logo.png";
import "./dasboard.css"
export const Dashboard = () => {
  return (
    <>
      <div className="header">
        <div class="logo">
          <img src={Logo} alt="Logo" />
        </div>
        <div class="user-details">
          <p>test</p>
        </div>
      </div>
    </>
  );
};
